import React from 'react';
import projects from "../data/projects";

export default function Projects() {
    const handleNext = () => {
        const element = projects.splice(0, 1);
        projects.push(element);
        console.log("funkcja")
    }
    return (
        <section className="projects" id="projects">
            {projects.forEach(el=>console.log(el))}
            <div className="projects__slider">
                {projects.map((project, idx)=>{
                    return <div className="projects__slider__element" key={idx}>{project.name}</div>
                })}
                <button className="projects__slider__btn projects__slider__btn--prev"></button>
                <button className="projects__slider__btn projects__slider__btn--next" onClick={handleNext}></button>
            </div>
        </section>
    )
}
